static void tup_free (VAL v) {
    PTUP ptup = VTUP(v);
    if (PTRISPTR(ptup)) {
        TUP* tup = PTRPTR(ptup);
        for (TUPLEN i = 0; i < tup->size; i++) {
            decref(tup->cells[i]);
        }
        free(tup);
    }
}

static void tup_decref_outer(PTUP ptup) {
    if (PTRISPTR(ptup)) {
        TUP* tup = PTRPTR(ptup);
        if (tup->refs == 1) {
            free(tup);
        } else {
            for (size_t i = 0; i < tup->size; i++) {
                incref(tup->cells[i]);
            }
            if (!--tup->refs) tup_free(MKTUP(ptup));
        }
    }
}

static TUPLEN tup_len_ (PTUP ptup) {
    if (PTRISPTR(ptup)) {
        TUP* tup = PTRPTR(ptup);
        return tup->size;
    } else {
        return 0;
    }
}

static void arr_free (VAL v) {
    ARR* arr = VARR(v);
    if (arr) {
        if ((arr->tag == 0) || (arr->tag & REFS_FLAG)) {
            for (USIZE i = 0; i < arr->size; i++) {
                decref(arr_peek_(arr,i));
            }
        }
        free(arr);
    }
}

